import React, { Component } from 'react'
import { Card, Button, Table, Space } from 'antd'
import {
    PlusOutlined
} from '@ant-design/icons';
import LinkButton from '../../../components/LinkButton';

export default class SiteInfo extends Component {
    render() {

        const columns = [
            {
                title: '序号',
                dataIndex: 'number',
                key: '1',
                align: 'center',
            },
            {
                title: '到达城市',
                dataIndex: 'end',
                key: '2',
                align: 'center',
            },
            {
                title: '用时（分）',
                dataIndex: 'useTime',
                key: '3',
                align: 'center',
            }
            ,
            {
                title: '操作', 
                key: '4',
                align: 'center',
                render: () => {
                    <Space size="middle">
                        <LinkButton >删除</LinkButton>
                    </Space>
                }
            }
        ];

        const data = [
            {
                key: '1',
                number: 1,
                end: '成都',
                useTime: 8,
            },
            {
                key: '2',
                number: 1,
                end: '北京',
                useTime: 7,
            },
        ]

        return (
            <div>
                <Table
                    columns={columns}
                    dataSource={data}
                    bordered
                    rowKey="key"
                    pagination={false}
                />
            </div>
        )
    }
}
